require.import ( [ "core" ] );

function SceneQueueManager () {

	var _this = this;
	var _sceneSet;
	var _currentScene;

	function _construct () {
		_sceneSet = [];
	}

	function _onNextSceneReady_listener ( event ) {
		
			// check if we have any scenes left
		if ( _sceneSet.length ) {

			var previousScene = event.target [ 0 ];
			_currentScene = _sceneSet.shift ();

			var commandSet = new CommandSet ();
			commandSet.listener ( _currentScene, "FADE_OUT_START", _onNextSceneReady_listener );
			commandSet.queue ();

			_currentScene.fadeIn ();
			
		}
	}

	_this.addScene = function ( scene ) {
		_sceneSet.push ( scene );
	}

	_this.nextScene = function () {

				// start the queue
		if ( _sceneSet.length ) {

			var commandSet = new CommandSet ();
			commandSet.listener ( _currentScene, "FADE_OUT_START", _onNextSceneReady_listener );
			commandSet.queue ();

			_currentScene.fadeOut ();
		}
	}

	_this.start = function () {
		
			// start the queue
		if ( _sceneSet.length ) {
			_currentScene = _sceneSet.shift ();

			var commandSet = new CommandSet ();
			commandSet.listener ( _currentScene, "FADE_OUT_START", _onNextSceneReady_listener );
			commandSet.queue ();

			_currentScene.fadeIn ();
		}
	} 

	return _construct ();
}
