	function _onPieceAddedMouseDown_listener ( event ) {

		// console.log ( "_onPieceAddedMouseDown_listener" );

		var dragObserver = new DragObserver ( event.currentTarget, GameModel.stage () );
		dragObserver.addEventListener ( "ITEM_DRAG", _onPieceAddedItemDrag_listener );
		dragObserver.addEventListener ( "ITEM_DROP", _onPieceAddedItemDrop_listener );
		dragObserver.activate ();

		var gamePiece = event.currentTarget.gamePiece;

		EVENTS.MEASUREMENT_PIECE_REMOVAL ( gamePiece.id () );

		// remove the piece
		// console.log("onPieceAdded: Splice sub pieces");
		_subPieces.splice ( _subPieces.indexOf ( gamePiece ), 1 );

			// animate the rest of the pieces into place
		var commandSet = new CommandSet ();
		for ( var i = 0, offsetX = 0; i < _subPieces.length; i++ ) {
			commandSet.tweenTo ( _subPieces [ i ].displayObject (), 0.35, { "x" : ( _subPieces [ i ].dropOffset ().x * GAMEBOARD_UNIT + offsetX ) } );
			offsetX += _subPieces [ i ].width () * GAMEBOARD_UNIT;
		}
		_commandQueues.push (commandSet.queue ());
	}

	function _onPieceAddedItemDrag_listener ( event ) {

		// console.log ( "_onPieceAddedItemDrag_listener" );


		var stage = GameModel.stage ();
		var gamePieceDO = event.data.item;

		var point = _container.globalToLocal ( stage.mouseX, stage.mouseY );
		var dropOffset = gamePieceDO.gamePiece.dropOffset ();

		gamePieceDO.x = point.x - dropOffset.x;
		gamePieceDO.y = point.y - dropOffset.y;
	}

	function _onPieceAddedItemDrop_listener ( event ) {

			// clean up the dragObserver
		var dragObserver = event.target [ 0 ];
		dragObserver.release ();

		var stage = GameModel.stage ();
		var gamePieceDO = event.data.item;
		var gamePiece = gamePieceDO.gamePiece;

		var point = _container.globalToLocal ( stage.mouseX, stage.mouseY );
		var dropOffset = gamePieceDO.gamePiece.dropOffset ();

		gamePieceDO.x = point.x - dropOffset.x;
		gamePieceDO.y = point.y - dropOffset.y;

		if ( _gameboardManager.canDropPieceToMeasurement ( gamePiece, stage.mouseX, stage.mouseY ) ) {
			_this.addSubpiece ( gamePiece );
			EVENTS.MEASUREMENT_PIECE_REMOVAL_READD ( gamePiece.id () );
		} else {
				// get rid of the piece
			var commandSet = new CommandSet ();
			commandSet.tweenTo ( gamePieceDO, 0.5, { "alpha" : 0 } );
			commandSet.apply ( function () { 
				_container.removeChild ( gamePieceDO );
			} );
			_commandQueues.push(commandSet.queue ());
			
		}
	}

