	/*
	* helper function to set up and add the display for a game piece
	* @param gamePiece:[AbstractGamePiece] - Game piece whose display should be added
	*/
	function _addGamePieceDisplay(gamePiece){

		var i, offsetX;
		var yOffset = ( gamePiece.id () == "Squiggly_piece" ) ? -1 : 0;
		var gamePieceDisplayObject = gamePiece.displayObject ();

		//Calculate offset due to existing placed pieces
		for (i = 0, offsetX = 0; i < _subPieces.length; i++ ) {
			offsetX += _subPieces [ i ].width () * GAMEBOARD_UNIT;
		}
		
		gamePieceDisplayObject.x = gamePiece.dropOffset ().x * GAMEBOARD_UNIT + offsetX;
		gamePieceDisplayObject.y = ( gamePiece.dropOffset ().y + yOffset ) * GAMEBOARD_UNIT;
		_container.mouseEnabled = true;
		_container.addChild ( gamePiece.displayObject () );
		_container.addChild ( gamePiece.topLayer () );
	}

	/*
	* helper function to remove the display for a game piece
	* @param gamePiece:[AbstractGamePiece] - Game piece whose display should be removed
	*/
	function _removeGamePieceDisplay(gamePiece){
		_container.removeChild ( gamePiece.topLayer () );
		_container.removeChild ( gamePiece.displayObject () ); 
	}

