		_container.addChild ( _handleBitmap );
		var handleHitArea = new createjs.Shape ();
		handleHitArea.graphics.beginFill ( "#000" ).drawRect ( 0, 0, 71, 98 );
		_handleBitmap.hitArea = handleHitArea;

		_subPieceLayer = new createjs.Container ();
		//_subPieceLayer.mouseEnabled = false;
		_container.addChild ( _subPieceLayer );

		_this.displayObject ( _outerContainer );

