		commandSet.tweenTo ( _container, 0.25, { "scaleX" : 1.1, "scaleY" : 1.1 } );
		commandSet.tweenTo ( _container, 0.35, { "scaleX" : 1, "scaleY" : 1 } );
		commandSet.queue ();
