function ScanLinesTube ( data ) {

	GamePiece.call ( this, data );

	var _super = {};
	var _this = this;

	var _animationSet;

	var _container;

	function _construct ( data ) {

		_animationSet = [];

		_container = new createjs.Container ();
		//container.mouseEnabled = false;
		_container.regX = 0.5 * GAMEBOARD_UNIT;
		_container.regY = 0.5 * GAMEBOARD_UNIT;

		for ( var i = 0; i < data.local.length; i++ ) {

			var animation = new lib.tube_scanlines_200 ();
			animation.x = -( data.local.length - data.reg.x - 0.5 ) * GAMEBOARD_UNIT + i * 75;
			animation.loop = true;
			_container.addChild ( animation );

			_animationSet.push ( animation );
		}

			// add in end caps
		var scanlineEndStart = new lib_2.scanlinesend ();
		scanlineEndStart.x = -( data.local.length - data.reg.x - 0.5 ) * GAMEBOARD_UNIT + ( data.local.length - 1 ) * 75;
		scanlineEndStart.loop = true;
		_container.addChild ( scanlineEndStart );

		var scanlineEndEnd = new lib_2.scanlinesend ();
		scanlineEndEnd.x = -( data.local.length - data.reg.x - 0.5 ) * GAMEBOARD_UNIT + GAMEBOARD_UNIT;
		scanlineEndEnd.scaleX = -1;
		scanlineEndEnd.loop = true;
		_container.addChild ( scanlineEndEnd );

		var startCap = AssetManager.getBitmap ( "pipe_end_cap" );
		startCap.x = -( data.local.length - data.reg.x - 0.5 ) * GAMEBOARD_UNIT;
		_container.addChild ( startCap );

		var endCap = AssetManager.getBitmap ( "pipe_end_cap" );
		endCap.x = ( data.local.length - data.reg.x + 0.5 ) * GAMEBOARD_UNIT - 5;
		_container.addChild ( endCap );

		_container.rotation = data.local.rotation;

		_this.displayObject ().addChild ( _container );

		return _this;
	}

	_super.release = _this.release;

	_this.release = function () {

		if ( !isEmpty ( _super ) ) {
			return;
		}

		if(!isEmpty(_container)){
			_container.removeAllChildren();	
		}
		_container = undefined;

		_animationSet = undefined;
		
		if(!isEmpty(_super)){
			_super.release();
		}
		_super = undefined;
	}

	return _construct ( data );
}
