	function _deactivatePulsating () {

		_pulsatingCommandQueue.cancel ();

		var commandSet = new CommandSet ();
		for ( var i = 0; i < _droppedPieceSet.length; i++ ) {
			if ( _droppedPieceSet [ i ] !=  _focusPiece && !isEmpty ( _droppedPieceSet [ i ].pulsate ) ) {
				_droppedPieceSet [ i ].pulsate ( true );
			}
		}
	}

	function _onPlayerBlocked_listener ( event ) {
		_quakeScene ();

		_player.dispatchEvent ( new Event ( "PLAYER_BLOCKED" ) )
	}

	function _onAddPiece_listener ( event ) {

			// remove measurementPieces
		var measurementPiece = event.target [ 0 ];

		if ( _measurementPieceSet.indexOf ( measurementPiece ) > -1 ) {
			var measurementPiece = _droppedPieceSet.splice ( _measurementPieceSet.indexOf ( measurementPiece ) );

			var pulsateSet = [];
			for ( var i = 0; i < _droppedPieceSet.length; i++ ) {
				if ( !isEmpty ( _droppedPieceSet [ i ].pulsate ) ) {
					pulsateSet.push ( _droppedPieceSet [ i ] );
				}
			}

			_pulsatingIter = new Iterator ( pulsateSet );
		}else{
			console.warn("GameBoardManager: Received add piece from unrecognized measurement piece!");
		}


		var subPieces = event.data.subPieces;

		// console.log("Add piece: subPieces:");
		console.dir(subPieces);


		var commandSet = new CommandSet ();
		for ( var i = 0, offsetX = 0, offsetY = 0; i < subPieces.length; i++ ) {

			
			commandSet.lock ( 500 );
			if ( event.data.vertical === true ) {
				commandSet.apply ( function () {
					var gamePiece = subPieces.shift ();
					_addPiece ( gamePiece, event.data.slotX, event.data.slotY + offsetY, true );
					offsetY += gamePiece.height ();
				} );
			} else {
				commandSet.apply ( function () {
					var gamePiece = subPieces.shift ();
					_addPiece ( gamePiece, event.data.slotX + offsetX, event.data.slotY, true );
					offsetX += gamePiece.width ();
				} );
			}
		}

			// test if we filled all the measurement pieces
		if ( GameModel.isInitialPlay () && _this.getPieceSet ( "MeasurementPiece" ).length == 0 ) {
			setTimeout ( function () { GameModel.triggerSequence ( { "id" : "GenericTalkSequence", "speech" : "Tube_Instr_7a" } ); }, 3000 );
		}
			// alert the player that they did a great job filling the gap
		/* commandSet.apply ( function () {
			_cachedTubeLayer.cache ( 0, 0, BOARD_WIDTH * GAMEBOARD_UNIT, BOARD_HEIGHT * GAMEBOARD_UNIT );
		} ); */

		_commandQueues.push(commandSet.queue ());
	}

	function _onRemovePiece_listener ( event ) {

			// retrieve a reference of the measurement piece
		var measurementPiece = event.data;

		//// console.log("GameBoardMan: Remove measurement piece");

			// remove the piece
		_removePiece ( measurementPiece );
		_tubeLayer.remove ( measurementPiece );
	}

