	/*
	* Remove focus from a piece
	* @param piece:[AbstarctGamePiece] - The piece to remove focus from
	*/
	function _removeFocusFromPiece(piece){
		if(_focusPiece != piece){
			console.warn("GameBoardManager: Removing focus from a piece which isn't set as the current focus piece!");
		}

		// turn back on all the pulsing effects
		_activatePulsating ();

		//If the piece losing focus is a measurement piece, re-enable the player launcher
		for ( var i = 0; i < _measurementPieceSet.length; i++ ) {

			//Enable player launching if this was the focussed measurement piece
			if(piece == _measurementPieceSet[i]){
				_canLaunchPlayer = true;
				_this.dispatchEvent ( new Event ( "NOTIFY_PLAYER_LAUNCH", true ) );
			}
			//_measurementPieceSet [ i ].displayObject ().mouseEnabled = true;
		}

		/*
		for ( var y = 0; y < _slots.length; y++ ) {
			for ( var x = 0; x < _slots.length; x++ ) {

					// is this slot empty and if it's not have we already assigned an index to the piece
				if ( !isEmpty ( _slots [ x ] [ y ] )  ) {
					
						// only reorder piece that are not in focus
					_slots [ x ] [ y ].reset ();
				}
			}
		}*/

		// unset the focus and arrange the pieces. It pretty universal. You can now launch the player
		_focusPiece = undefined;
		//_tubeLayer.addChild ( _focusPiece.displayObject () );
		_arrangePiecesInOrder ();
	}

