	function _onPlayerQueryNextGamePiece_listener ( event ) {

		var player = event.target [ 0 ];

			// let find the next piece
		var gamePiece = event.data.gamePiece;
		var pathHelper = event.data.pathHelper;
		var exitInfo = pathHelper.exitInfo ();
		var exitDirection = exitInfo.direction;
		var exitPoint = exitInfo.point;

		// compile the next spot to query
		var queryEntrySlotX = exitPoint.x + gamePiece.slotX () + exitDirection.x;
		var queryEntrySlotY = exitPoint.y + gamePiece.slotY () + exitDirection.y;

		// // console.log ( "_onPlayerQueryNextGamePiece_listener" );
		// // console.log ( gamePiece.slotX () + " " + gamePiece.slotY () + " " + exitDirection.x + " " + exitDirection.y );

		var playerfailed = false; 

		if(!isEmpty(gamePiece.showEndGlow)) {
			gamePiece.showEndGlow();
		}

			// is there a game piece there
		if ( _isSlotEmpty ( queryEntrySlotX, queryEntrySlotY ) ) {

			setTimeout ( function () { GameModel.triggerSequence ( { "id" : "GenericTalkSequence", "speech" : "Tube_Instr_13" } ) }, 1500 );

			player.dispatchEvent ( new Event ( "PLAYER_LOSE" ) );
			player.lose ();
			return;
		} else {

				// Get the next piece to query 
			var nextPiece = _slots [ queryEntrySlotX ][ queryEntrySlotY ];

			var nextPathHelper = nextPiece.queryPath ( queryEntrySlotX, queryEntrySlotY, exitDirection );

			//// console.log ( nextPathHelper );

			if ( nextPathHelper !== false ) {
				nextPathHelper.reset ();
			}

				// either we've found the next piece or this player is GAME OVER, like the "Denver Broncos" OHHHHH! BURN!!!
			if ( !isEmpty ( nextPathHelper ) ) {
				player.bindToGamePiece ( nextPiece, nextPathHelper, 0 );
				if(!isEmpty(nextPiece.showStartGlow)) {
					nextPiece.showStartGlow();
				}

					// save the current piece
				_currentPiece = nextPiece;
			} else {



				player.dispatchEvent ( new Event ( "PLAYER_LOSE", { "status" : Player.NO_TRACK } ) );
				player.lose ();
				playerfailed = true;

			}
		}

		if ( playerfailed ) {

			EVENTS.PLAYER_DEAD_END ();

			_quakeScene ();

			var commandSet = new CommandSet ();

				// find out why the missing is missing
			switch ( nextPiece.id () ) {
				case "RotatePiece2x2" :
				case "RotatePiece1x1" :
				case "S_CURVE_ROTATION" :
				case "U_CURVE_ROTATION" :
					nextPiece.highLight ();
					AssetManager.playSound ( "21_Hit Unturned Pipe Section" );
					setTimeout ( function () { GameModel.triggerSequence ( { "id" : "GenericTalkSequence", "speech" : "Tube_Math_8" } ) }, 1500 );
					break;
				case "FlipPiece2x2" :
				case "U_CURVE_FLIP" :
				case "S_CURVE_FLIP" :
					nextPiece.highLight ();
					AssetManager.playSound ( "21_Hit Unturned Pipe Section" );
					setTimeout ( function () { GameModel.triggerSequence ( { "id" : "GenericTalkSequence", "speech" : "Tube_Math_7" } ) }, 1500 );
					break;
				case "MeasurementPiece" :
				case "VerticalMeasurementPiece" :
					commandSet.lock ( 500 );
					commandSet.apply ( function () { nextPiece.highLight (); } );
					AssetManager.playSound ( "21_Hit Unturned Pipe Section" );
					
					setTimeout ( function () { GameModel.triggerSequence ( { "id" : "GenericTalkSequence", "speech" : "Tube_Math_6" } ) }, 1500 );
					break;
				default : 
					setTimeout ( function () { GameModel.triggerSequence ( { "id" : "GenericTalkSequence", "speech" : "Tube_Instr_13" } ) }, 1500 );
				
					// _this.dispatchEvent ( new Event ( "PLAYER_SPEAK", [ "The track is not connect. The wrong path was chosen" ] ) );
			}

			_commandQueues.push(commandSet.queue ());

			_activatePulsating ();
		}
	}

