	_this.dropPiece = function ( gamePiece, mouseStageX, mouseStageY ) {

		_dropOverlay.graphics.clear ();

			// use the dropInfo to find which slots should/could be taken
		var dropGrid = gamePiece.dropMask ();
		var dropOffset = gamePiece.dropOffset ();

			// convert to local coordinates, then add the drop offset to align the grid
		var point = _container.globalToLocal ( mouseStageX, mouseStageY );
		var slotX = Math.round ( ( point.x - dropOffset.x * GAMEBOARD_UNIT ) / GAMEBOARD_UNIT );
		var slotY = Math.round ( ( point.y - dropOffset.y * GAMEBOARD_UNIT ) / GAMEBOARD_UNIT );
 
		for ( var gridX = slotX, dropX = 0; gridX < ( slotX + dropGrid.length ); gridX++, dropX++ ) {
			for ( var gridY = slotY, dropY = 0; gridY < ( slotY + dropGrid [ 0 ].length ); gridY++, dropY++ ) {
				if ( dropGrid [ dropX ] [ dropY ] == 1 ) {
					_slots [ gridX ] [ gridY ] = gamePiece;
				}
			}
		}

			// set the top-left slotX and slotY
		gamePiece.slotX ( slotX );
		gamePiece.slotY ( slotY );

			// now shift the piece to the correct spot
		var gamePieceDO = gamePiece.displayObject ();
		var gamePieceTweenX = slotX * GAMEBOARD_UNIT + dropOffset.x * GAMEBOARD_UNIT + 1;
		var gamePieceTweenY = slotY * GAMEBOARD_UNIT + dropOffset.y * GAMEBOARD_UNIT + 1;

			// fix the gamePiece position
		gamePiece.displayObject ().x -= _container.x;
		gamePiece.displayObject ().y -= _container.y;
		_tubeLayer.add ( gamePiece );

			// arrange the pieces in order
		_arrangePiecesInOrder ();

		//TweenMax.to ( );

		var commandSet = new CommandSet ();
		commandSet.tweenTo (  gamePiece.displayObject (), 0.15, { "x" : gamePieceTweenX, "y" : gamePieceTweenY, "ease" : Cubic.easeOut } );
		commandSet.tweenTo ( GameModel.stage (), 0.05, {  "scaleX" : 1.05, "scaleY" : 1.05, "ease" : Cubic.easeOut } );
		commandSet.tweenTo ( GameModel.stage (), 0.05, { "scaleX" : 1, "scaleY" : 1, "ease" : Cubic.easeIn } );
		commandSet.tweenTo ( GameModel.stage (), 0.05, {  "scaleX" : 1.025, "scaleY" : 1.025, "ease" : Cubic.easeOut } );
		commandSet.tweenTo ( GameModel.stage (), 0.05, { "scaleX" : 1, "scaleY" : 1, "ease" : Cubic.easeIn } );
		commandSet.tweenTo ( GameModel.stage (), 0.05, {  "scaleX" : 1.0125, "scaleY" : 1.0125, "ease" : Cubic.easeOut} );
		commandSet.tweenTo ( GameModel.stage (), 0.05, { "scaleX" : 1, "scaleY" : 1, "ease" : Cubic.easeIn } );
		_commandQueues.push(commandSet.queue ());

			// register the gamepiece so we can track it
		_droppedPieceSet.push ( gamePiece );
		gamePiece.addEventListener ( "ITEM_PICK_UP", _onItemPickUp_listener );
	}

