	_this.queryTrackPath = function ( gamePiece, pathHelper ) {

		var trackInfo = { "complete" : false, "gamePieceInfoSet" : [] };
		var exitInfo = pathHelper.exitInfo ();
		var exitDirection = exitInfo.direction;
		var exitPoint = exitInfo.point;

			// find the next piece
		var queryEntrySlotX = exitPoint.x + gamePiece.slotX () + exitDirection.x;
		var queryEntrySlotY = exitPoint.y + gamePiece.slotY () + exitDirection.y;

			// is there a game piece there. Keep looping until we fail to find a gamePiece or 
		var isSlotEmpty = _isSlotEmpty ( queryEntrySlotX, queryEntrySlotY ); 
		while ( !isSlotEmpty ) {
			if ( isSlotEmpty ) {
				
					// well that was easy... A little too easy >:/
				return trackInfo;

			} else {

					// reassign the in
				var nextPiece = _slots [ queryEntrySlotX ][ queryEntrySlotY ];
				var nextPathHelper = nextPiece.queryPath ( queryEntrySlotX, queryEntrySlotY, exitDirection );

				// console.log ( nextPathHelper );

				trackInfo.gamePieceInfoSet.push ( { "gamePiece" : nextPiece, "pathHelper" : nextPathHelper } );

					// we're all done
				if ( nextPiece !== false ) {
					return trackInfo;
				} else if ( nextPiece instanceof DestinationPiece ) {
					trackInfo.complete = true;
					return trackInfo;
				}

					// find the next piece
				exitInfo = nextPathHelper.exitInfo ();
				exitDirection = exitInfo.direction;
				exitPoint = exitInfo.point;
				queryEntrySlotX = exitPoint.x + gamePiece.slotX () + exitDirection.x;
				queryEntrySlotY = exitPoint.y + gamePiece.slotY () + exitDirection.y;
				isSlotEmpty = _isSlotEmpty ( queryEntrySlotX, queryEntrySlotY ); 
			}
		}
	}
	
	_this.getPieceSet = function ( type ) {
		var resultSet = [];
		for ( var x = 0; x < _slots.length; x++ ) {
			for ( var y = 0; y < _slots.length; y++ ) {
				
				var gamePiece = _slots [ x ][ y ];
				if ( gamePiece && gamePiece.id () == type && resultSet.indexOf ( gamePiece ) == -1 ) {
					resultSet.push ( gamePiece );
				}
			}
		} 
		
		return resultSet;
	}
	
