		_playerSet = undefined;
		
		if(!isEmpty(_emitterSet)){
			for (i = 0; i < _emitterSet.length; i++ ) {
				_emitterSet [ i ].release ();
			}
		}
		_emitterSet = undefined;


		if(!isEmpty(_commandQueues)){
			for (i = 0; i < _commandQueues.length; i++ ){
				_commandQueues [ i ].cancel ();
				_commandQueues [ i ].release ();
			}
		}
		_commandQueues = undefined;

		if(!isEmpty(_droppedPieceSet)){
			for ( var i = 0; i < _droppedPieceSet.length; i++ ) {

					// check if it a static and basic gamePiece or an advance one
				//var gamePiece = _droppedPieceSet [ i ];
				//gamepiece.release ();

			}
		}
		_droppedPieceSet = undefined;

		// console.log("GameBoardManager: Release me from my horrible fate! 3");

		_pulsatingCommandQueue.release();
		_pulsatingCommandQueue = undefined;

		_container.removeAllChildren();
		_container = undefined;

		_tubeLayer.release ();
		
		_shape = undefined;
		_slotOverlay = undefined;
		_dropOverlay = undefined;
		_tubeLayer = undefined;
		_cachedTubeLayer = undefined;
		_operationLayer = undefined;
		
		// console.log("GameBoardManager: Release me from my horrible fate! 4");

		//Clear out all the board slots and associated game pieces
		if(!isEmpty(_slots)){			

			for(i = _slots.length - 1; i >= 0; i--){				

				for(j = _slots[i].length - 1; j >= 0; j--){
					if(!isEmpty(_slots[i][j] )){						
						// _slots[i][j].release();

						gamePiece = _slots [ i ][ j ];

						if ( gamePiece.canRecycle () ) {
							GamePiecePool.recycle ( gamePiece );
						} else {
							gamePiece.release ();
						}

						delete _slots[i][j];
					}
				}
				delete _slots[i];
			}
		}
		_slots = undefined;

		//Clear the measurement pieces
		// console.log("Measurement PIeces:");
		console.dir(_measurementPieceSet);
		if(!isEmpty(_measurementPieceSet )){
			// console.log("GameBoardMan: We got " + _measurementPieceSet.length + " measurement pieces");

			for(i = 0; i < _measurementPieceSet.length; i++){
				_measurementPieceSet[i].removeEventListener( "ADD_PIECES_FROM_MEASUREMENT", _onAddPiece_listener );
				_measurementPieceSet[i].removeEventListener ( "REMOVE_MEASSUREMENT_PIECE", _onRemovePiece_listener );
  				_measurementPieceSet[i].removeEventListener ( "PLAYER_SPEAK", _onPlayerSpeak_listener );
				_measurementPieceSet[i].release ();
				delete _measurementPieceSet [ i ];
			}
		}
		_measurementPieceSet = undefined;
		
		_levelData = undefined;
		_startPiece = undefined;
		_focusPiece = undefined;
		
		
		_pulsatingIter = undefined;
