//Class BaseMeasureInventoryManager
// Provides a base for all measurement inventory managers


/*
* Create a new BaseMeasureInventoryManager
* @param subclassReference:[Object] - Reference to the object subclassing this
*/
function BaseMeasureInventoryManager(subclassReference){

	//Inherit from AbstractObject
	var _this = AbstractObject ( subclassReference );

	//[Object] - The current owner of this manager
	_this._owner = null;

	/*
	* Take ownership of this manager
	* @param obj:Object - The object that will take ownership
	*/
	_this.takeOwnership = function(obj){
		 "use strict";

		_this._owner = obj;
	}

	/*
	* Release ownership of this manager
	* @param obj:Object - The object that wants to release ownership.  
	*	NOTE: If this object isn't the current owner, nothing will happen
	*/
	_this.releaseOwnership = function(obj){
		 "use strict";

		if(obj == _this._owner){
			_this._owner = null;
		}
	}

	/*
	* Get the current owner of this manager
	* @return:[Object] - The current owner of this manager or null if there isn't one
	*/
	_this.getOwner = function(){
		 "use strict";
		 
		return _this._owner;
	}

	return _this;
}
