var TIMEOUT_WAIT = 17500;

function SequenceManager ( data, captionText, gameBoardManager ) {

	var _super = {};
	var _this = AbstractObject ( this );

	var _initCommandQueue;
	var _sequenceSet;
	var _gameBoardManager;
	var _captionText;
	var _skipSequence;
	var _currentSequence;

	var _timeOutInterval;
	var _timeOutIter;
	var _triggerQueue;
	var _timeOutIterMap;

	function _construct ( data, captionText, gameBoardManager ) {
		
		_sequenceSet = [];

		_gameBoardManager = gameBoardManager;
		
		_captionText = captionText;

		_initCommandQueue = new CommandQueue ();

		_skipSequence = new SkipSequence ();
		_skipSequence.addEventListener ( "SKIP", _onSkipSequence_listener );

			// load the triggers
		_triggerQueue = new CommandQueue ( null, true );

		_load ( data );
	}

	function _timeOut_callback ( event ) {

		if ( !_timeOutIter.hasNext () ) {
			_timeOutIter.reset ();
		}

		_currentSequence = _timeOutIter.next ();

		if ( isEmpty ( _currentSequence ) ) {
			return;
		}

		if ( GameModel.isSequencePlayable ( _currentSequence.id () ) ) {
			
			_this.cancel ();

			_currentSequence.start ();
		}

		_timeOutInterval = setTimeout ( _timeOut_callback, TIMEOUT_WAIT );
	}

	/* function _onMouseDown_listener ( event ) {

		clearTimeout  ( _timeOutInterval );
		_timeOutInterval = setTimeout ( _timeOut_callback, TIMEOUT_WAIT );
	} */

	function _onTriggerSequence_listener ( event ) {

	}

	function _onSequenceTimeOutChange_listener ( event ) {

	}

	function _onSkipSequence_listener ( event ) {

		_currentSequence.cancel ();
		
	}

	function _load ( data ) {

		
			// handle the init stuff
		if ( !isEmpty ( data.init ) ) {
			
			var initSequenceSet = [];
			var initSequenceCommandSet = new CommandSet ();
			
				// automatically init any tutorials in the inti section
			
			for ( var i = 0; i < data.init.length; i++ ) {
					// save a copy so we can clear memory
				var sequence = _getSequence ( data.init [ i ] );	
				_sequenceSet.push ( sequence );
				initSequenceSet.push ( sequence );
			}
			
			//_captionText.attachSkipOverlay ( _skipSequence );
			//_skipSequence.start ();

			var sequenceIter = new Iterator ( initSequenceSet );
			for ( var i = 0; i < initSequenceSet.length; i++ ) {

				if ( GameModel.isSequencePlayable ( initSequenceSet [ i ].id () ) ) {

					initSequenceCommandSet.apply ( function () { 
						
							// cancel the previous sequnece
						if ( !isEmpty ( _currentSequence ) ) {
							_currentSequence.cancel ();
						}

						_currentSequence = sequenceIter.next ();
						_currentSequence.start ();

							// add in the ability to cancel the sequece
						//_skipSequence.start ();
					} );
					initSequenceCommandSet.listener ( initSequenceSet [ i ], "COMPLETE" );
					initSequenceCommandSet.lock ( 750 );
				} else {
					sequenceIter.next ()
				}
			}

				
			initSequenceCommandSet.apply ( function () { 
				
					// stop the sequence
				_skipSequence.stop ();
				
					// activate the pulsating
				if ( !isEmpty ( _gameBoardManager ) ) {
					_gameBoardManager.activatePulsating ();
				} 
			} );
	
				// queue the initial commandSet
			_initCommandQueue.queue ( initSequenceCommandSet );
		}

		_timeOutIterMap = {};

			// handle the timeout stuff
		if ( !isEmpty ( data.time_out ) ) {

			_timeOutIterMap = {};

			var timeOutSequenceSet = [];
			var timeoutSequeneceCommandSet = new CommandSet ();

			for ( var name in data.time_out ) {
				
				var sequenceSet = [];

				// console.log ( data.time_out [ name ] );

				for ( var i = 0; i < data.time_out [ name ].length; i++ ) {
					sequenceSet.push (  _getSequence ( data.time_out [ name ] [ i ] ) );
				}

				_timeOutIterMap [ name ] = new Iterator ( sequenceSet );

			}

			// console.log ( _timeOutIterMap );

			_timeOutIter = _timeOutIterMap [ "default" ];
			//GameModel.stage ().addEventListener ( "stagemousedown", _onMouseDown_listener );

			if ( _timeOutIter.length () > 0 ) {
				_timeOutInterval = setTimeout ( _timeOut_callback, TIMEOUT_WAIT );
			}
			
		} 

	}

	function _getSequence ( data ) {
		return new window [ String ( data.id ) ] ( data, _gameBoardManager, _captionText );
	}

	_this.cancel = function () {

		_initCommandQueue.cancel ();
		_triggerQueue.cancel ();

		while ( _sequenceSet.length ) {
			_sequenceSet.pop ().cancel ();
		}

			// clear the interval
		clearTimeout ( _timeOutInterval ); 
	}

	_this.start = function () {
		_initCommandQueue.start ();
	}

	_this.changeTimeout = function ( id ) {

		clearTimeout  ( _timeOutInterval );
		
		_timeOutIter = _timeOutIterMap [ id ];

		// console.log ( "changeTimeout : " + id );
		// console.log ( _timeOutIter );

		_timeOutIter = ( isEmpty ( _timeOutIter ) ) ? new Iterator ( [] ) : _timeOutIter;

		

		if ( _timeOutIter.length () > 0 ) {
			_timeOutInterval = setTimeout ( _timeOut_callback, TIMEOUT_WAIT );
		}
	}

	_this.triggerSequence = function ( data ) {

		console.log("SeqMan - triggerSequence: " + data.id);

		ss.SoundManager.stopAllSounds ();

			// pick a random sequence
		_this.cancel ();

		if ( data instanceof Array ) {

			var commandSet = new CommandSet ();
			var sequenceIter = new Iterator ( data );
			var cancelledMainSequence = false;

				// iterate through all the 
			for ( var i = 0; i < data.length; i++ ) {

				var voiceOverSet = data [ i ].speech.split ( "," );
				var firstId = voiceOverSet [ 0 ];
				var selectedVoiceOver = new Iterator ( voiceOverSet ).shuffle ().next ();

				var voiceOverInfo = VOICE_OVER_SET [ selectedVoiceOver ];

				if ( GameModel.isSequencePlayable ( firstId ) ) {
					
						// set the first sequence
					if ( !cancelledMainSequence ) {
						_this.cancel ();
						cancelledMainSequence = true;
					}
					

					commandSet.apply ( function () {

						_triggerQueue.stop ();

						var sequenceInfo = sequenceIter.next ();
						_currentSequence = _getSequence ( sequenceInfo );
						_sequenceSet.push ( _currentSequence );

						var innerCommandSet = new CommandSet ();
						innerCommandSet.listener ( _currentSequence, "COMPLETE" );
						// innerCommandSet.apply ( function () { console.log ( "restarting trigger" ); _triggerQueue.start () } );
						innerCommandSet.queue ();

						_currentSequence.start ();
					} );

				}
			}

			_triggerQueue.queue ( commandSet );

		} else {

			var voiceOverSet = data.speech.split ( "," );
			var firstId = voiceOverSet [ 0 ];
			var selectedVoiceOver = new Iterator ( voiceOverSet ).shuffle ().next ();

			var voiceOverInfo = VOICE_OVER_SET [ selectedVoiceOver ];

			// console.log ( firstId );

			if ( GameModel.isSequencePlayable ( firstId ) ) {

					// the hats are off. Everything must go
				_this.cancel ();

				_currentSequence = _getSequence ( data ); // new GenericTalkSequence ( voiceOverInfo, _gameBoardManager, _captionText );
				_sequenceSet.push ( _currentSequence );
				
				if ( voiceOverInfo.play_once === true ) {
					var commandSet = new CommandSet ();
					commandSet.listener ( _currentSequence, "COMPLETE" );
					commandSet.apply ( function () { GameModel.sequencePlayed ( firstId ); } );
					commandSet.queue ();
				}
				

				_currentSequence.start ();

				return _currentSequence;
			}
		}
	}

	_super.release = _this.release;
	_this.release = function () {

		_initCommandQueue = undefined;
		_sequenceSet = undefined;
		_gameBoardManager = undefined;
		_captionText = undefined;
		_skipSequence = undefined;
		_currentSequence = undefined;
		_timeOutInterval = undefined;
		_timeOutIter = undefined;
		_triggerQueue = undefined;
		_timeOutIterMap = undefined;

		if(!isEmpty(_super)){
			_super.release ();	
		}
		_super = undefined;
	}

	return _construct ( data, captionText, gameBoardManager );
}
