require.import ( [ "core", "managers" ] )

function AbstractScene ( reference ) {

	var _super = {};
	var _this = AbstractObject ( reference );

	var _$container;
	var _stage;
	var _soundSet;

	var _commandQueues = [];

	function _construct () {
		

		_stage = new createjs.Container ();
		// _stage.alpha = 0;

		return _this;
	}

	_this.$container = function ( value ) {
		return ( isEmpty ( value ) ) ? _$container : _$container = value;
	}

	_this.stage = function () {
		return _stage;
	}

	_this.fadeIn = function () {

			// stop all sounds
		createjs.Sound.stop ();

			// a whole ton stuff happening here 
		var commandSet = new CommandSet ();
		commandSet.dispatchEvent ( _this, new Event ( "FADE_IN_START" ) );
		commandSet.apply ( function () { GameModel.stage ().addChild ( _stage ); } );
		commandSet.dispatchEvent ( _this, new Event ( "SCENE_START" ) );
		commandSet.tweenTo ( _stage, 1, { "alpha" : 1 } );
		commandSet.dispatchEvent ( _this, new Event ( "SCENE_READY" ) );
		commandSet.dispatchEvent ( _this, new Event ( "FADE_IN_COMPLETE" ) );
		_commandQueues.push(commandSet.queue ());

		
	}

	_this.fadeOut = function () {

		if ( isEmpty ( _stage ) ) {
			return;
		}

		

		_stage.removeAllChildren();

		var commandSet = new CommandSet ();
		commandSet.dispatchEvent ( _this, new Event ( "FADE_OUT_START" ) );
		commandSet.tweenTo ( _stage, 1, { "alpha" : 0 } );
		commandSet.apply ( function () {  
			GameModel.stage().removeChild ( _stage );
			_stage = undefined;

			PieceSetManager.clearAllInventoryPieces ();

			try {
				throw "Memory clear";
			} catch ( e ) {

			}

				// clear all tweens
			//TweenMax.kill ();
		} );
		commandSet.lock ( 1000 );
		commandSet.dispatchEvent ( _this, new Event ( "NEXT_SCENE_READY" ) );
		commandSet.apply ( function () { _this.release () } );
		_commandQueues.push(commandSet.queue ());
	}

	_this.showSubScene = function ( subScene ) {

		_stage.addChild ( subScene.displayObject () );

		subScene.start ();
	}

	_super.release = _this.release;

	_this.release = function () {

		if(!isEmpty(_commandQueues )){
			for (var i = 0; i < _commandQueues.length; i++) {
				_commandQueues[i].release();
			}
		}
		
		_commandQueues = undefined;

		if(!isEmpty(_super)){
			_super.release();
		}
		_super = undefined;
		_$container = undefined;
		_stage = undefined;
		_soundSet = undefined;

	}

	return _construct ();
} 
require.import ( [ "core", "managers" ] );

function LoadingScene () {
	
	var _super = {};
	var _this = AbstractScene ( this );
	var _$container;

	var _progress;

	var _loadCommandQueue;

	function _construct () {

		AssetManager.addEventListener ( "ASSET_LOAD_COMPLETE", _onLoadComplete_listener );
		AssetManager.addEventListener ( "FILE_LOADED", _onFileLoaded_listener );
		AssetManager.addEventListener ( "SOUND_LOAD_COMPLETE", _onSoundLoaded_listener );
		AssetManager.load ( GAME_DATA );

		_progress = 0;

		_$container = $ ( "#preload_scene" );
		_this.$container ( _$container );
	}

	function _onLoadComplete_listener () {

		if ( _progress < 80 ) {
			return;
		}

		$ ( "#loading_text" ).html ( "100%" );

		$ ( "#tube_video_ctn" ).fadeIn ().mouseup ( _onLoadAudio_listener );

		var commandSet = new CommandSet ();

		//commandSet.tweenTo ( _$container.find ( "#loading_bar" ), 0.25, { "opacity" : 0, "top" : "425px" } );
		commandSet.css ( _$container.find ( "#loading_start_button" ), { "display" : "block", "cursor" : "pointer" } );
		commandSet.tweenTo ( $ ( "#tube_video_play_btn, #tube_video_skip_btn" ), 0.25, { "scale" : 1.2 } );
		commandSet.tweenTo ( $ ( "#tube_video_play_btn, #tube_video_skip_btn" ), 0.25, { "scale" : 1 } );
		commandSet.queue ();
	}

	function _onFileLoaded_listener ( event ) {

			// fake progress loading
		_progress = Math.ceil ( event.data.loaded / event.data.count * 100 ) ;

		TweenMax.to ( $ ( "#loading_bar_progress" ), 0.25, { "width" : _progress + "%" } );

		$ ( "#loading_text" ).html ( _progress + "%" );
	}

	function _onLoadAudio_listener ( event ) {

		
		var commandSet = new CommandSet ();
		commandSet.tweenTo ( $ ( "#Video_Holder" ), 0.5, { "opacity" : 0 } );
		commandSet.apply ( function () {
			
			try {
				myPlayer.unload ();
			} catch ( e ) {

			}
			$ ( "#Video_Holder" ).remove ();
			$ ( "#loading_audio_container" ).css ( { "display" : "block" } );
		} );
		commandSet.tweenTo ( $ ( "#loading_audio_container" ), 0.5, { "opacity" : 1 } );
		commandSet.apply ( function () { AssetManager.loadSounds (); } );

		_loadCommandQueue = commandSet.queue ();

		$ ( "#tube_video_ctn" ).unbind ();
	}

	function _onSoundLoaded_listener ( event ) {

		_loadCommandQueue.cancel ();

		var commandSet = new CommandSet ();
		//commandSet.tweenTo ( $ ( "#loading_audio_container, #Video_Holder" ), 0.25, { "opacity" : 0 } );
		commandSet.apply ( function () { 
			$ ( "#loading_audio_container" ).css ( { "display" : "none" } );
			$ ( "#loading_audio_container" ).remove ();
			$ ( "#Video_Holder" ).remove ();
		} );
		commandSet.queue ();

		

			// we're all done
		_this.fadeOut ();
	}

	_super.fadeOut = _this.fadeOut;
	_this.fadeOut = function () {

		_super.fadeOut ();

		var commandSet = new CommandSet ();
		commandSet.tweenTo ( $ ( "#preload_scene" ), 1, { "opacity" : 0 } );
		commandSet.apply ( function () {
			$ ( "#preload_scene" ).remove ();
		} );
		commandSet.queue ();
	}

	_super.release = _this.release;

	_this.release = function () {

		_super.release();
		_super = undefined;
		_$container = undefined;
		_progress = undefined;
		_loadCommandQueue = undefined;

	}

	return _construct ();
}
