function CaptionText () {
	
	var _super = {};
	var _this = AbstractObject ( this );

	var _container;
	var _bgBitmap;
	var _text;
	var _darkText;

	var _commandQueue;

	var _iter;

	function _construct () {

		_commandQueue = new CommandQueue ();
		_commandQueue.start ();

		_container = new createjs.Container ();
		_container.mouseEnabled = false;

		_bgBitmap = AssetManager.getBitmap ( "caption_bg" );
		_bgBitmap.alpha = 0;
		_container.addChild ( _bgBitmap );

		_darkText = new createjs.Text ( "", "40px RefrigeratorDeluxe-Bold", "#000" );
		_darkText.mouseEnabled = false;
		_darkText.x = 835 * 0.5 + 5;
		_darkText.y = 20 + 5;
		_darkText.lineHeight = 45;
		_darkText.textAlign = "center";
		_darkText.lineWidth = 835;
		_container.addChild ( _darkText );

		_text = new createjs.Text ( "", "40px RefrigeratorDeluxe-Bold", "#FFF" );
		_text.mouseEnabled = false;
		_text.x = 835 * 0.5;
		_text.y = 20;
		_text.lineHeight = 45;
		_text.textAlign = "center";
		_text.lineWidth = 835;
		_container.addChild ( _text );
	}

	_this.show = function ( textSet ) {

		console.log ( "checking captions" + GameModel.captions () );

		if ( !GameModel.captions () ) {
			return
		}

		console.log ( "showing captions" );

		_commandQueue.cancel ();

		var commandSet = new CommandSet ();
		commandSet.apply ( function () {
			_container.addChild ( _bgBitmap );
			_container.addChild ( _darkText );
			_container.addChild ( _text );
		} );
		commandSet.tweenTo ( _bgBitmap, 0.35, { "alpha" : 1 } );

		_iter = new Iterator ( textSet );

		for ( var i = 0; i < textSet.length; i++ ) {

			commandSet.tweenTo ( [ _text, _darkText ], 0.25, { "alpha" : 0 } );
			commandSet.apply ( function () {
				var textInfo = _iter.next ();
				_darkText.text = _text.text = textInfo.text;

			} );
			commandSet.tweenTo ( [ _text, _darkText ], 0.5, { "alpha" : 1 } );
			commandSet.lock ( GameModel.getSpeechInfo ( textSet [ i ].id ).duration );
		}

		commandSet.tweenTo ( [ _text, _darkText ], 0.5, { "alpha" : 0 } );
		commandSet.tweenTo ( _bgBitmap, 0.5, { "alpha" : 0 } );
		commandSet.apply ( function () { 
			_container.removeChild ( _bgBitmap );
			_container.removeChild ( _text );
			_container.removeChild ( _darkText );
		} );

		_commandQueue.queue ( commandSet );
	}

	_this.displayObject = function () {
		return _container;
	}

	_this.cancel = function () {
		_commandQueue.cancel ();

		var commandSet = new CommandSet ();
		commandSet.tweenTo ( [ _text, _darkText ], 0.2, { "alpha" : 0 } );
		commandSet.tweenTo ( _bgBitmap, 0.2, { "alpha" : 0 } );
		commandSet.apply ( function () {
			_container.removeChild ( _bgBitmap );
			_container.removeChild ( _text );
			_container.removeChild ( _darkText );
		} );
		_commandQueue.queue ( commandSet );
	}

	return _construct ();
}
