function ComplexTimeOutSequence ( data, gameBoardManager, gameSceneAvatar ) {
	
	var _super = {};
	var _this = AbstractObject ( this );
	
	var _gameSceneAvatar;
	var _commandQueue;
	var _soundSet;
	var _iter;

	function _construct ( data, gameBoardManager, gameSceneAvatar ) {
		_gameBoardManager = gameBoardManager;
		_gameSceneAvatar = gameSceneAvatar;
		_soundSet = [];

		_iter = new Iterator ( [ SPEACH_SET [ "Tube_Instr_12" ], SPEACH_SET [ "Tube_Instr_13" ] ]);
		_iter.shuffle ();
	}

	_this.id = function () {
		return "Tube_Instr_12";
	}
	
	_this.start = function () {

			// lock the gameboard manager
		//_gameBoardManager.displayObject ().mouseEnabled = false;

		var commandSet = new CommandSet ();
		var duration = 0;

		if ( !_iter.hasNext () ) {
			_iter.reset ();
		}

		if ( GameModel.isInitialPlay () ) {

			commandSet.lock ( 1200 );
			commandSet.apply ( function () {
				var speechInfo = _iter.next ();
				_soundSet.push ( AssetManager.playSound ( speechInfo.asset, speechInfo.offset, speechInfo.duration ) );
				_gameSceneAvatar.talk ( speechInfo.text_set );
			} );	
			commandSet.lock ( _iter.peek ().duration + 1000 );
		}
		commandSet.dispatchEvent ( _this, new Event ( "COMPLETE" ) );
		
		_commandQueue = commandSet.queue ();
	}
	
	_this.cancel = function () {
		_commandQueue.cancel ();
		
		ss.SoundManager.stopAllSounds ()
	}

	_super.release = _this.release;

	_this.release = function () {
		try {
			_super.release();
			_super = undefined;
			_this = undefined;
			_gameSceneAvatar = undefined;
			_commandQueue = undefined;
			_soundSet = undefined;
			_iter = undefined;
		} catch (e) {
			console.warn("ComplexTimeOutSequence released more than once.");
		}

	}

	return _construct ( data, gameBoardManager, gameSceneAvatar );
}
