		gamePiece.drag ( _stage.mouseX, _stage.mouseY );
		_stage.addChild ( gamePiece.displayObject () );

			// the dragObserver is self contained, we just need to listen for dragging and dropping for now
		var dragObserver = new DragObserver ( gamePiece, _stage );
		dragObserver.addEventListener ( "ITEM_DRAG", _onItemDrag_listener );
		dragObserver.addEventListener ( "ITEM_DROP", _onItemDrop_listener );
