achievements = {
	
	achievements: [ ],
	
	init: function() {
		
	},
	
	// add achievement id, execute doneFunction when completed
	add: function(achievementId, doneFunction) {
		$.post("../../php/addAchievement.php", { username:achievements.getCookie("pbskids.username"), userid:achievements.getCookie("pbskids.userid"), achievement:achievementId } ).done(doneFunction);
	},
	
	// gets all achievements, execute doneFunction when completed passing along array of achievement ids
	// achievement ids are also stored in achievements
	get: function(doneFunction) {
		// keep trying until pbs object is loaded
		if (typeof PBS === 'undefined' || typeof PBS.KIDS === 'undefined' || typeof PBS.KIDS.identity === 'undefined') { 
			setTimeout(function() { achievements.get(doneFunction); }, 500);
			return;
		}
		$.post("../../php/getAchievements.php", { username:achievements.getCookie("pbskids.username"), userid:achievements.getCookie("pbskids.userid") } ).done(function(data) {
			achievements.achievements = data.split("/");
			doneFunction(achievements.achievements);
			});
	},
	
	// clear all achievements, execute doneFunction when completed
	clear: function(doneFunction) {
		$.post("../../php/clearAchievement.php", { username:achievements.getCookie("pbskids.username"), userid:achievements.getCookie("pbskids.userid") } ).done(doneFunction);
	},
	
	// read a cookie
	getCookie: function(c_name) {
		var c_start;
		var c_end;		
		if (document.cookie.length > 0) {
			c_start = document.cookie.indexOf(c_name + "=");
			if (c_start !== -1) {
				c_start = c_start + c_name.length + 1;
				c_end = document.cookie.indexOf(";", c_start);
				if (c_end === -1) { c_end = document.cookie.length; }
				return unescape(document.cookie.substring(c_start, c_end));
			}
		}
		return "";
	}	
	
};

