$ ( window ).resize ( function () {

	if ( $ ( window ).width () / ( $ ( window ).height () - AGENT_BAR_HEIGHT ) > 1024 / 768 ) {
        var scale = ( $ ( window ).height () - AGENT_BAR_HEIGHT ) / 768;
    }
    else {
        var scale = $ ( window ).width () / 1024; 
    }

    if ( isMobile.iOS () ) {
        scale -= 0.1;
    }
    
    var css = { "width" : 1024 * scale, "height" : 768 * scale }; 
    var top = ( scale - 1.0 ) * 768 * 0.5 + ( ( $ ( window ).height () - AGENT_BAR_HEIGHT ) - 768 * scale ) * 0.5 + AGENT_BAR_HEIGHT;
    var left = ( scale - 1.0 ) * 1024 * 0.5 + ( $ ( window ).width () - 1024 * scale ) * 0.5;

    if ( isMobile.iOS () ) {
        top += 10;
    }

    var transform = "scale(" + scale + ")";
    $ ( ".scene" ).css ( "MozTransform", transform ).css ( "transform", transform ).css ( "WebkitTransform", transform ).css ( "msTransform", transform ).css ( {
        "top" : top,
        "left" : left 
    } );
} );

function _onRety_Next_Level_listener ( event ) {

	
    var gameScene = new GameScene ();
	gameScene.addEventListener ( "LEVEL_SELECT", _onLevelSelect_listener );
	gameScene.addEventListener ( "RETRY_LEVEL", _onRety_Next_Level_listener );
	gameScene.addEventListener ( "NEXT_LEVEL", _onRety_Next_Level_listener );
	sceneQueueManager.addScene ( gameScene );

		// retrieve and fadeOut the old content
	var oldScene = event.target.pop ();
	oldScene.fadeOut ();
}

function _onLevelSelect_listener ( event ) {

	var gameScene = new GameScene ();
	gameScene.addEventListener ( "LEVEL_SELECT", _onLevelSelect_listener );
	gameScene.addEventListener ( "RETRY_LEVEL", _onRety_Next_Level_listener );
	gameScene.addEventListener ( "NEXT_LEVEL", _onRety_Next_Level_listener );

		// queue up the level select then the game scene
	sceneQueueManager = new SceneQueueManager ();
	sceneQueueManager.addScene ( new LevelSelectScene () );
	sceneQueueManager.addScene ( gameScene );
	sceneQueueManager.start ();

		// retrieve and fadeOut the old content
	var oldScene = event.target.pop ();
	oldScene.fadeOut ();
}

